import React from "react";

const ViewProfile = () =>
{
    return(
        <div>
            <h3>Employee Profile</h3>
                <p>UserName:</p>
                <p>FirstName: </p>
                <p>LastName: </p>
                <p>Gender: </p>
                <p>Date of Birth: </p>
                <p>Phone: </p>
                <p>Email: </p>
                <p>NID: </p>
        </div>
    );
}
export default ViewProfile;
